                                "tob_value": "AED 25,000\r\n\r\nFor In-patients:\r\n- Covered up to limit per married eligible female employee & spouse\r\n- Where any condition develops which becomes an emergency, the medically necessary expenses will be covered up to the annual aggregate limit\r\n\r\nFor Out-patients:\r\n- Cover includes 8 visits to PHC; All care provided by PHC obstetrician for low risk or specialist obstetrician for high risk referrals\r\n- Initial investigations to include:\r\nFBC and Platelets Blood group, Rhesus status and antibodies, VDRL MSU & urinalysis, Rubella serology. HIV Hep C offered to high risk patients GTT if high risk. FBS, Random blood sugar OR HbA1C for all due to high prevalence of diabetes in UAE\r\n- Visits to include review, checks and test in accordance with DHA Antenatal Care Protocols 3 ante-natal ultrasound scans",
